import React, {Component} from 'react';
import Option from './Option'


class Settings extends Component {

    render(props){
        return (
          <div>
                <Option optionType="Animal" key="animal" optionsData={["Cats","Dogs"]} selected={this.props.type} onChange={this.props.handleTypeChange}/>
                <br/><br/>
                <Option optionType="Level" key="level" optionsData={["Easy","Medium","Hard"]} selected={this.props.level} onChange={this.props.handleLevelChange}/>
                <br/><br/>
                <button onClick={this.props.handleResetGame}>Reset Game</button>
          </div>
        )
      }

}




export default Settings
